import planetInfo from "../service/getPlanetInfo";
import { useState, useEffect } from "react";
import PlanetDetail from "./PlanetDetail";

function RandomPlanet(props) {
  const [randoPlanet, setRandoPlanet] = useState([]);

  const fetchRandoPlanets = async () => {
    const data = await planetInfo();
    console.log(data);
    setRandoPlanet(data.planets);
  };
  useEffect(() => {
    fetchRandoPlanets();
  }, []);

  return (
    <div className="RandoPlanets">
      <h1>Random Planet</h1>
      {randoPlanet.map((planetObj, index) => {
        return (
          <div>
            <PlanetDetail {...planetObj} key={index} />
          </div>
        );
      })}
    </div>
  );
}

export default RandomPlanet;
